import React from 'react';
import { render } from 'react-dom'; // Change the import
import './index.css';
import App from './App';
import CssBaseline from '@mui/material/CssBaseline';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Provider } from 'react-redux'; // Import the Provider
import store from '.components/store/storeLogin'; // Import your Redux store

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#ff262a',
    },
    secondary: {
      main: '#29b6f6',
      light: '#8BC34A',
    },
    error: {
      main: '#D32F2F',
    },
    warning: {
      main: '#FFA000',
      light: '#FFC107',
    },
    info: {
      main: '#2196F3',
      light: '#64B5F6',
    },
    success: {
      main: '#4CAF50',
      light: '#8BC34A',
    },
  },
  typography: {
    fontFamily: 'Karla',
  },
})

const root = document.getElementById('root');

render( // Use render instead of ReactDOM.createRoot
  <Provider store={store}> {/* Wrap the App with the Provider */}
    <React.StrictMode>
      <CssBaseline />
      <ThemeProvider theme={theme}>
        <App />
      </ThemeProvider>
    </React.StrictMode>
  </Provider>,
  root
);

export { theme };
